        "category": "performing-arts",
        "description": "When the stunning Warner Theatre opened in 1929, an icon was born on the world-famous Atlantic City Boardwalk. Dubbed the \"Wonder Theatre of the World,\" the building became an East Coast mecca for star-studded entertainment. Now, almost a century later, Spiegelworld is undertaking a multi-million dollar resurrection of THE HOOK, retaining its beautiful, original, ocean-view façade. Opening June 2023 at Caesars Atlantic City Hotel & Casino and operating every week of the year, THE HOOK will feature a world-premiere live show, an East Coast home for our awesome Italian-American-Psychedelic Superfrico restaurant, and several discoverable cocktail bars. As Atlantic City's first-ever permanent entertainment residency, The Hook live show is directed by Britain's leading comedy director Cal McCrystal (Atomic Saloon Show, One Man Two Guvnors). Of course, you can expect Spiegelworld's signature blitz of ridiculous fun, jaw-dropping wow, and sizzling hot superhumans from around the world.",
